import React, { useState } from 'react'
import '../App.css'

export default function TransportPanel() {
  const [activeTab, setActiveTab] = useState('Asignación')

  const navItems = ['Conductor', 'Pasajero', 'Rutas', 'Incidencias', 'Asignación', 'Auto']

  return (
    <div className="transport-panel">
      <header className="header">
        <div className="container">
          <h1>MK TRANSPORTE</h1>
        </div>
      </header>

      <nav className="nav">
        <div className="container nav-content">
          <div className="nav-buttons">
            {navItems.map((item) => (
              <button
                key={item}
                className={`nav-button ${activeTab === item ? 'active' : ''}`}
                onClick={() => setActiveTab(item)}
              >
                {item}
              </button>
            ))}
          </div>
          <button className="logout-button">CERRAR SESIÓN</button>
        </div>
      </nav>

      <main className="main">
        <div className="container">
          <div className="content-box">
            <h2>PANEL DE CONTROL - {activeTab}</h2>
            {/* Add content for each tab here */}
          </div>
        </div>
      </main>
    </div>
  )
}
